import 'bootstrap/dist/css/bootstrap.min.css';
import React, { StrictMode } from 'react';
import { createRoot } from 'react-dom/client';
import App from './layout/app';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Basic from "./layout/basic";
import PreguntasFrec from './layout/preguntasfrec';
import Preguntas from './layout/preguntas'

const feather = require('feather-icons');
setTimeout(() => {
  feather.replace();
}, 1000);

const router = createBrowserRouter([
  {
    path: "/",
    element: <Basic />,
    children: [
      {
        path: '',
        element: (
          <div>
            <App />
          </div>
        ),
      },
      {
        path: "/detalle/:slug",
        element: <div>Detalle</div>, // Placeholder for the Detalle component
      },
    ],
  },
  {
    path: "/preguntasfrecuentes",
    element: <PreguntasFrec />,
    children: [
      {
        path: '',
        element: (
          <div>
            <Preguntas />
          </div>
        ),
      },
      {
        path: "/preguntasfrecuentes/:slug",
        element: <div>Pregunta Detalle</div>, // Placeholder for the Pregunta Detalle component
      },
    ],
  },
]);

const root = createRoot(document.getElementById("root"));
root.render(
  <RouterProvider router={router} />
);
